import { useState, useEffect, use } from 'react';

function ShowImages() {
  const [imgs, setImgs] = useState([])
  const [text, setText] = useState([])

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("http://localhost:3000/data-scrapper")
      const output = await response.json()

      setImgs(output.imgs)
      setText(output.text)
  
      console.log(output.text)
    }
    getData()
  }, [])

  return (
    <div>
      {imgs.map((img, indexImg) => {
          return(
            <>
              <img key={indexImg} src={img} alt=''></img>

            </>
          ) 
        })
      }

      {text.map((text, indexText) => {
        console.log(text)

          return(
            <>
                  <p key={indexText}>P/L {text[indexText].pl}</p>
                  <p key={indexText}>P/VP {text[indexText].pvp}</p>
                  <p key={indexText}>DY {text[indexText].dy}</p>
                  <p key={indexText}>ROE {text[indexText].roe}</p>
                </>
              ) 
          })
        }
    </div>
  );
}

export default ShowImages
